import React from 'react';

export default ({ input, label, image, text, textmeta: { error, touched } }) => {
	return (
		<div className="card">
			<img src={image} style={{ borderRadius: '50%' }} />
			<div className="body">
				<h3>{label}</h3>
				<p>{text}</p>
			</div>
			<a class="blue darken-1 waves-effect waves-light btn">Learn More</a>
		</div>
	);
};
